  //     .then((response) => response.json())
  //     .then((json) => setWorkItems(json))
  //     .catch((error) => console.error(error));
  // }, []);
  return (
    <div className="grid-container">
      {workList.map((item, index) => (
        <WorkItem
          title={item.title}
          thumbnail={item.thumbnail}
          type={item.type}
          id={item.projectId}
          key={index}
        ></WorkItem>
      ))}
    </div>
  );
}

export default WorkGallery;
